style.css:
/* Apply Special Elite font to the entire body */
body {
  font-family: 'Special Elite', cursive;
}

/* Apply Special Elite font to headings */
h1, h2, h3, h4, h5, h6 {
  font-family: 'Special Elite', cursive;
}

/* Apply Special Elite font to paragraphs */
p {
  font-family: 'Special Elite', cursive;
}
